import './page2.css';
import React from "react";
/* Chat function on this page */


function chat() {

    function redirect() {
        window.location.href = 'http://localhost:5000';
        return null;
      } 

    return ( 

        <button onClick={redirect}>
        Click to redirect
      </button>
    );
}

export default chat;
